import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{r as e,o as s,c as l,d as A,e as a,a as u,f as r}from"./app-dd6359fc.js";const c={},d=r(`<p>垃圾回收机制（Garbage Collection）</p><p>Java引入了垃圾回收机制，令C++程序员最头疼的内存管理问题得以解决。Java程序员可以将更多的精力放到业务逻辑上，而不是内存管理上，提高了开发效率</p><p>在C++中，程序员不仅需要开发业务代码，还要关注内存管理问题。如果某一个对象不再使用了，则需要进行回收，否则程序很有可能因为这个对象没有被回收而导致宕机</p><p>简单来比喻一下垃圾回收机制的概念：</p><blockquote><p>现在有两个饭店，分别代表了C++和Java。</p><p>在C++的饭店中，客人吃完饭需要擦干净桌子再走。</p><p>如果某一个客人用餐过后，没有擦桌子，那这个桌子就相当于一直处于被占用的状态</p><p>而在Java的饭店中，有一个“服务员”专门去擦桌子，这个“服务员”就是我们说的垃圾回收机制</p><p>客人只管吃饭，吃完后不用擦桌子，服务员就把擦桌子的工作做了</p></blockquote><p>一些面向对象的语言要求您跟踪创建的所有对象，并在不再需要它们时显式销毁它们。显式地管理内存是乏味且容易出错的。Java平台允许您创建任意数量的对象（当然，受系统处理能力的限制），您不必担心会破坏它们。当Java运行时环境确定不再使用对象时，将删除这些对象。这个过程称为垃圾收集。</p><p>当不再有对该对象的引用时，该对象可以进行垃圾回收。当变量超出范围时，通常会删除变量中的引用。或者，通过将变量设置为特殊值null，可以显式删除对象引用。请记住，一个程序可以对同一个对象有多个引用；在对象符合垃圾收集条件之前，必须删除对该对象的所有引用。</p><p>Java运行时环境有一个垃圾收集器，它定期释放不再被引用的对象所使用的内存。垃圾收集器在确定时间合适时自动执行其任务。</p><h2 id="内存管理及垃圾回收过程" tabindex="-1"><a class="header-anchor" href="#内存管理及垃圾回收过程" aria-hidden="true">#</a> 内存管理及垃圾回收过程</h2><h3 id="内存管理" tabindex="-1"><a class="header-anchor" href="#内存管理" aria-hidden="true">#</a> 内存管理</h3><p>Java的内存管理很大程度指的就是对象的管理，其中包括对象空间的分配和释放。</p><p><code>对象空间的分配</code>：使用new关键字创建对象即可</p><p><code>对象空间的释放</code>：将对象赋值null即可。垃圾回收器将负责回收所有”不可达”对象的内存空间。</p><h3 id="垃圾回收过程" tabindex="-1"><a class="header-anchor" href="#垃圾回收过程" aria-hidden="true">#</a> 垃圾回收过程</h3><p>任何一种垃圾回收算法一般要做两件基本事情：</p><ol><li><p>发现无用对象</p></li><li><p>回收无用对象的内存空间</p></li></ol><p>垃圾回收机制保证可以将“无用的对象”进行回收。无用的对象指的就是没有任何变量引用该对象。</p><p>Java的垃圾回收器通过相关算法发现无用对象，并进行清除和整理</p><h2 id="垃圾回收相关算法" tabindex="-1"><a class="header-anchor" href="#垃圾回收相关算法" aria-hidden="true">#</a> 垃圾回收相关算法</h2><h3 id="引用计数法" tabindex="-1"><a class="header-anchor" href="#引用计数法" aria-hidden="true">#</a> 引用计数法</h3><p>堆中的每一个对象都有一个引用计数，被引用一次，计数+1，被引用变量值为null，则计数-1，直到计数为0，则表示变为无用对象。</p><p>优点是算法简单，缺点是“循环引用的无用对象”无法被识别</p><p>循环引用示例</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">Student</span> <span class="token punctuation">{</span>
    <span class="token class-name">String</span> name<span class="token punctuation">;</span>
    <span class="token class-name">Student</span> friend<span class="token punctuation">;</span>

    <span class="token keyword">public</span> <span class="token keyword">static</span> <span class="token keyword">void</span> <span class="token function">main</span><span class="token punctuation">(</span><span class="token class-name">String</span><span class="token punctuation">[</span><span class="token punctuation">]</span> args<span class="token punctuation">)</span> <span class="token punctuation">{</span>
        <span class="token class-name">Student</span> s1 <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Student</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token class-name">Student</span> s2 <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Student</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

        s1<span class="token punctuation">.</span>friend <span class="token operator">=</span> s2<span class="token punctuation">;</span>
        s2<span class="token punctuation">.</span>friend <span class="token operator">=</span> s1<span class="token punctuation">;</span>

        s1 <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">;</span>
        s2 <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>s1和s2这两个对象互相引用，导致他们的计数不为零，实际已经无用，但无法被识别</p><h3 id="引用可达法" tabindex="-1"><a class="header-anchor" href="#引用可达法" aria-hidden="true">#</a> 引用可达法</h3><p>程序把所有引用关系看做一张图，从一个节点GC ROOT开始，寻找对应的引用节点，找到这个节点之后，继续寻找这个节点的引用节点，当所有的引用节点寻找完毕后，剩余的节点则被认为是没有被引用到的节点，即无用的节点</p><h2 id="通用的分代垃圾回收机制" tabindex="-1"><a class="header-anchor" href="#通用的分代垃圾回收机制" aria-hidden="true">#</a> 通用的分代垃圾回收机制</h2><p>分代垃圾回收机制，是基于这样一个事实:不同的对象的生命周期是不一样的。因此，不同生命周期的对象可以采取不同的回收算法，以便提高回收效率。我们将对象分为三种状态∶年轻代、年老代、持久代。</p><p>JVM将堆内存划分为 Eden、Survivor 和 Tenured/Old 空间。</p><p>Eden、Survivor是存放年轻代的地方。Tenured/old是存放年老代的地方</p><p>而持久代的存放位置是方法区</p><h3 id="年轻代" tabindex="-1"><a class="header-anchor" href="#年轻代" aria-hidden="true">#</a> 年轻代</h3><p>所有新生成的对象首先都是放在Eden区。年轻代的目标就是尽可能快速的收集掉那些生命周期短的对象，对应的是Minor GC，每次 Minor GC会清理年轻代的内存，算法采用效率较高的复制算法，频繁的操作，但是会浪费内存空间。当“年轻代”区域存放满对象后，就将对象存放到年老代区域。</p><h3 id="年老代" tabindex="-1"><a class="header-anchor" href="#年老代" aria-hidden="true">#</a> 年老代</h3><p>在年轻代中经历了N(默认15)次垃圾回收后仍然存活的对象，就会被放到年老代中。因此，可以认为年老代中存放的都是一些生命周期较长的对象。年老代对象越来越多，我们就需要启动Major GC和Full GC(全量回收)，来一次大扫除，全面清理年轻代区域和年老代区域。</p><h3 id="持久代" tabindex="-1"><a class="header-anchor" href="#持久代" aria-hidden="true">#</a> 持久代</h3><p>用于存放静态文件，如Java类、方法等。持久代对垃圾回收没有显著影响。</p><img src="data:image/png;base64,"><p><code>Minor GC</code> 用于清理年轻代区域。Eden区满了就会触发一次<code>Minor GC</code>。清理无用对象，将有用的对象复制到<code>Survivor1</code>、<code>Survivor2</code> 区中（这两个区，大小空间也相同，同一时间 <code>Survivor1</code> 和 <code>Survivor2</code> 只有一个在使用，另外一个为空）</p><p><code>Major GC</code> 用于清理年老代区域。</p><p><code>Full GC</code> 用于清理年轻代、年老代区域。成本较高，会对系统性能产生影响</p><p>垃圾回收过程：</p><ol><li><p>新创建的对象，绝大多数都会存储在Eden中</p></li><li><p>当Eden满了（达到一定的比例）不能创建新的对象，则触发垃圾回收机制（GC），将无用对象清理掉，然后剩余对象到某个Survivor中，如Survivor1，同时清空Eden区</p></li><li><p>当Eden区再次满了，会将Survivor1区中的不能清空的对象，也复制进Survivor1，保证Survivor1和Eden区，都被清空</p></li><li><p>重复多次（默认15次）Survivor中没有被清理的对象，则会复制到年老代（Tenured/Old）区中</p></li><li><p>当Old区满了，则会触发一个一次完整地垃圾回收机制（Full GC），之前新生代的垃圾回收称为（Minor GC）</p></li></ol><h2 id="其他注意事项" tabindex="-1"><a class="header-anchor" href="#其他注意事项" aria-hidden="true">#</a> 其他注意事项</h2>`,45),v={href:"https://docs.oracle.com/javase/8/docs/technotes/guides/vm/gctuning/considerations.html#sthref63",target:"_blank",rel:"noopener noreferrer"};function o(t,i){const n=e("ExternalLinkIcon");return s(),l("div",null,[d,A("p",null,[a("官方文档："),A("a",v,[a("https://docs.oracle.com/javase/8/docs/technotes/guides/vm/gctuning/considerations.html#sthref63"),u(n)])])])}const V=p(c,[["render",o],["__file","垃圾回收机制.html.vue"]]);export{V as default};
